          <th>Marca</th>
          <th>Precio</th>
          <th>Iva</th>
          <th>Categoria</th>
        </tr>
      </thead>
      <tbody>
       {this.state.tabla}
      </tbody>
    </Table>
       <div className="d-grid">
       <a href="/" type="submit" className="btn btn-primary">
         Log out
       </a>
     </div>
     </div>
  );
  };}

export default Home
